import React, { useState } from "react";
import "../src/css/dep.css";
import Upi from "./Upi";
function Dep() {
  const [amount, setamount] = useState();
  const [upi, setupi] = useState(false);
  const twenty = async () => {
    setupi(true);
    setamount(20);
  };
  const fifty = () => {
    setamount(50);
  };
  const hundred = () => {
    setamount(100);
  };
  const fivehundred = () => {
    setamount(500);
  };
  const thousand = () => {
    setamount(1000);
  };
  const twothousand = () => {
    setamount(2000);
  };
  return upi ? (
    <Upi />
  ) : (
    <div className="dmain">
      <div className="dbody">
        <div className="dh">DEPOSIT</div>
        <br />
        <button onClick={twenty} className="mdb">
          20
        </button>

        <button className="db" onClick={fifty}>
          50
        </button>
        <button className="db" onClick={hundred}>
          100
        </button>
        <br />
        <button onClick={fivehundred} className="mdb">
          500
        </button>
        <button className="db" onClick={thousand}>
          1000
        </button>
        <button className="db" onClick={twothousand}>
          2000
        </button>
      </div>
    </div>
  );
}
export default Dep;
